import React from "react";

const Post = (title = "title", body = "body") => {
  return (
    <div class="col mb-4">
      <div class="card h-100">
        {/* <img src="..." class="card-img-top" alt="..." /> */}
        <div class="card-body">
          <h5 class="card-title">{title}</h5>
          <p class="card-text">{body}</p>
        </div>
      </div>
    </div>
  );
};

export default Post;
